pragma solidity >=0.4.21 <0.7.0;

contract Vote {
  address private pass;
  uint public eDate;
  uint public cDate;
  address public onwer;
  string public owner2;

  struct Candidate {
    uint id;
    uint count;
  }
  Candidate[] arrgs;
  address[] register;
  constructor(address _pass,uint _oDate,uint _cDate,address _owner, string memory _owner2,uint _candidate) public {
    pass = _pass;
    eDate = _oDate;
    cDate = _cDate;
    onwer = _owner;
    owner2 = _owner2;
    cDate = now;
    for (uint i = 0;i < _candidate;i++){
        arrgs.push(Candidate(i,0));
    }
  }
  function getInformation() public view returns(address,address,uint,uint,address,string memory){
    return (address(this),pass,eDate,cDate,onwer,owner2);
  }
  function getCandidates() public view returns(uint[] memory, uint[] memory){  
    uint[] memory id = new uint[](arrgs.length);
    uint[] memory count = new uint[](arrgs.length);
    for (uint i = 0;i<arrgs.length;i++){
      id[i] = arrgs[i].id;
      count[i] = arrgs[i].count;
    }
    return(id,count);
  }
  modifier onlyOnwer(){
    require(msg.sender == onwer,"only onwer");
    _;
  }
  modifier outDate(){
    require(now <= eDate,"out of date");
    _;
  }
  modifier allow(){
      bool kt = false;
      for (uint i = 0;i<register.length;i++) if (register[i] == msg.sender) kt = true;
      require(kt == true,"Chua dang ky");
      _;
  }
  function candidate(uint _id) public onlyOnwer() {
    uint x = arrgs.length;
    for (uint i = 0;i < _id;i++){
        arrgs.push(Candidate(x+i,0));
    }
  }

   function registry(address[] memory _register) public onlyOnwer() {
    for (uint i = 0;i < _register.length;i++){
        register.push(_register[i]);
    }
  }
   function registry(address _address) public onlyOnwer() {
    register.push(_address);
  }
  function registry( uint8 _v, bytes32 _r, bytes32 _s) public returns(bool){
       address x = ecrecover(keccak256(abi.encodePacked(msg.sender)), _v, _r, _s);
       if (x == pass) {
         register.push(msg.sender);
         return true;
       }
       else return false;
  }
  function vote(uint _id) public outDate() allow()  {
    for (uint i = 0 ;i<arrgs.length;i++){
      if (arrgs[i].id == _id){
        arrgs[i].count = arrgs[i].count++;
        break;
      }
    }
  }
}

contract Creator {
  event creat(address _address,address _pass,uint _oDate,uint _cDate,address _owner, string _owner2,uint _candidate);
  mapping (address=> bool) public list;
  mapping (address => address[]) public myVote;
  function getMyVote() public view returns(address[] memory) {
    return myVote[msg.sender];
  }
  function creatVote(address _pass,uint _eDate, string memory _owner,uint _candidate) public   {
    uint _cDate = now;
    Vote x = new Vote(_pass,_eDate,_cDate,msg.sender,_owner,_candidate);
    list[address(x)] = true;
    myVote[msg.sender].push(address(x));
    emit creat(address(x),_pass,_eDate,_cDate,msg.sender,_owner,_candidate);
  }
}
